import React from 'react';
import { BrowserRouter as Router, Route, Routes, Link } from 'react-router-dom';
import SubmitNews from 'forms\frontend\src\components\SubmitNews.js';
import FilterNews from './FilterNews';
import './App.css';

const App = () => {
  return (
    <Router>
      <div className="app-container">
        <div className="navbar">
          <h1>Crime News History Documentation</h1>
          <div className="navbar-buttons">
            <Link to="/" className="nav-button">Submit News</Link>
            <Link to="/filter" className="nav-button">Filter News</Link>
          </div>
        </div>
        <Routes>
          <Route path="/" element={<SubmitNews />} />
          <Route path="/filter" element={<FilterNews />} />
        </Routes>
      </div>
    </Router>
  );
};

export default App;
